import styles from './Categories.module.scss';
import all from "../../assets/Images/all.png";
import food from "../../assets/Images/food.png";
import fruits from "../../assets/Images/fruits.png";
import drinks from "../../assets/Images/drinks.png";
import iceCream from "../../assets/Images/ice-creams.png";
const Categories = () => {
  return (
    <div className={styles.categories}>
      <div className={styles['category-box']}>
        <img src={all} alt="all-icons" />
        <button type="button">All</button>
      </div>

      <div className={styles['category-box']}>
        <img src={food} alt="food-icon" />
        <button type="button">Food</button>
      </div>

      <div className={styles['category-box']}>
        <img src={fruits} alt="fruits-icon" />
        <button type="button">Fruits</button>
      </div>

      <div className={styles['category-box']}>
        <img src={drinks} alt="drinks-icon" />
        <button type="button">Drinks</button>
      </div>

      <div className={styles['category-box']}>
        <img src={iceCream} alt="ice-cream-icon" />
        <button type="button">Ice Cream</button>
      </div>
    </div>
  );
}

export default Categories;
